// components/Experience.jsx
import React from "react";
import "../styles/Experience.css";

const timelineData = [
  {
    year: "2022",
    title: "Started Learning HTML & CSS",
    description: "Began my journey with front-end development using HTML and CSS.",
  },
  {
    year: "2023",
    title: "JavaScript & React",
    description: "Learned JavaScript and built dynamic user interfaces with React.",
  },
  {
    year: "2024",
    title: "Advanced Projects",
    description: "Worked on several real-world projects to enhance my skills.",
  },
];

function Experience() {
  return (
    <section className="experience-section" id="experience">
      <h2 className="experience-heading">Experience Timeline</h2>
      <div className="timeline">
        {timelineData.map((item, index) => (
          <div className="timeline-item" key={index}>
            <div className="timeline-content">
              <span className="timeline-year">{item.year}</span>
              <h3 className="timeline-title">{item.title}</h3>
              <p className="timeline-description">{item.description}</p>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Experience;
